import React from "react";
import { useLocation } from "react-router";

export default function ServiceUser() {
  const location = useLocation();

  const temp = JSON.parse(localStorage.getItem(location.state.service));

  const temp2 = temp.filter((object, index) => {
    return object.id === location.state.id;
  });
  const handle = () => {
    localStorage.setItem(location.state.service);
  };

  return (
    <div>
      {JSON.stringify(temp)}
      {JSON.stringify(temp2)}

      <button onClick={handle}></button>
    </div>
  );
}
